    true,nt"url": null,nt"notes": "<p>In 2009, the 10 states where per capita
    spending was highest ranged from 13 to 36 percent higher than the national average,
    and the 10 states where per capita spending was lowest ranged from 8 to 26 percent
    below the national average. States with the highest per capita spending tended to
    have older populations and the highest per capita incomes, states with the lowest
    per capita spending tended to have younger populations, lower per capita incomes,
    and higher rates of uninsured.</p>n",nt"license_title": "Other License Specified",nt"extras":
